#creating a dictionary that will return 100 crochet listings in the Etsy API website using our apiKey
def getListingsCrochet():

    url = 'https://openapi.etsy.com/v3/application/listings/active' #this API requires parameters and headers so we've included it in the dictionary
    headers = {
        'x-api-key': apiKey,
    }
    params = {
        'limit': 100, #the API only lets us receive 100 iterations at a time (and we need atleast 4,000) so we're going to fix this later
        'keywords':"crochet"
    }
    r = requests.get(url, headers=headers,params=params)

    if r.status_code == 200:
        data = r.json()
        return data['results']
    else:
        print(f"Request failed with status code {r.status_code}: {r.text}") #making sure we add some "except" or "else" statement so our colab doesn't crash
