def getListingsFromShops(ids):
    url = f'https://openapi.etsy.com/v3/application/shops/{ids}/listings/active'
    headers = {
        'x-api-key': apiKey,
    }
    params = {
        'limit': 100,
        'keywords': "crochet"
    }

    try:
        r = requests.get(url, headers=headers, params=params)
        r.raise_for_status()  # Raise an HTTPError for bad responses (4xx and 5xx status codes)

        if r.status_code == 200:
            data = r.json()
            return data['results']
        else:
            print(f"Request failed with status code {r.status_code}: {r.text}")
            return None

    except requests.exceptions.RequestException as e:
        print(f"Request failed: {e}")
        return None
#because our previous functions could only get 100 listings and we need atleast 4,000 iterations, we created a new function where if will iterate through the previous function over and over
def repeatGetListingsFromShops(shopIds):
    expandedList = []
    for i in shopIds:
      expandedList = expandedList + getListingsFromShops(i)
    return expandedList
expandedListings = repeatGetListingsFromShops(shop_id)

