def createDataframe(listings):
  #each column will be a list
  title = []
  id = []
  description = []
  price = []
  views = []
  tags = []
  item_weight = []
  quantity = []
  url =[]
  num_favorers = []
  state = []
  is_customizable = []
  listing_type = []
  type_listing = []
  image_id = []
  for i in listings: #looping over every iteration and adding them to their lists
    id.append(i["listing_id"])
    title.append(i["title"])
    description.append(i["description"])
    price.append(i["price"])
    views.append(i["views"])
    tags.append(i["tags"])
    item_weight.append(i["item_weight"])
    quantity.append(i["quantity"])
    url.append(i["url"])
    num_favorers.append(i["num_favorers"])
    state.append(i["state"])
  data = { #here we're concatenating the lists into one dictionary along with their keys (column names)
      'id': id,
      'title':title,
      'description': description,
      'price': price,
      'views': views,
      'tags': tags,
      'item_weight': item_weight,
      'quantity': quantity,
      'url': url,
      'num_favorers': num_favorers,
      'state': state
  }

  df = pd.DataFrame(data) #turning our dictionary of lists before into our dataframe
  return df
