#next we'll make a function to filter out the list of crochet items we did previously and make sure we don't have any duplicates
def keep_duplicates(input_list):
    string_counts = {}
    result_list = []
    for string in input_list:
        if string in string_counts:
            string_counts[string] += 1
        else:
            string_counts[string] = 1
    for string, count in string_counts.items():
        if count > 1:
            result_list.extend([string] * count)

    return result_list
