#now another function to help make our pie chart that will display the weight between amigurumi, patterns, and crochet in the market
def create_top_n_pie_chart(data, n):
    string_counts = Counter(data)
    top_n_items = string_counts.most_common(n)

    labels = [item[0] for item in top_n_items]
    counts = [item[1] for item in top_n_items]

    plt.pie(counts, labels=labels, autopct='%1.1f%%', startangle=120)
    plt.title(f'Crochet Market Category Composition')

    plt.show()

