substrings_to_remove = ["pattern", "crochet","amigurumi","tag","tags","labels","patterns","leather"]


def process_word(word, substrings):
    components = word.split()
    cleaned_components = [component for component in components if component not in substrings]
    cleaned_word = ' '.join(cleaned_components)

    return cleaned_word

for i, inner_list in enumerate(lowercase_list_of_lists):
    lowercase_list_of_lists[i] = [process_word(word, substrings_to_remove) for word in inner_list]

